" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    IgM deposition in preeclampsia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Immunofluorescence microscopy in preeclampsia showing diffuse IgM deposition. This represents nonspecific entrapment of larger proteins in the more permeable glomerular capillary wall, rather than the formation of discrete immune complexes. There is, for example, generally no deposition of IgG.",
